        "title": "25 Young Hollywood Stars Who Came Out As LGBTQ",
        "description": "Khelani, Miley Cyrus, and Paris Jackson Are Among 25 Young Celebrities Who Are Part Of The LGBTQ Community. \nSubscribe: https://goo.gl/Hnoaw3\n-----------------------------------------------------------------------------------------\n\nThere was a time when opening up about who you’re attracted to could be the end of your career, especially in Hollywood! Thankfully, that time is rapidly ending and more young people than ever before are becoming role models for those who may still feel like they’re stuck in the closet. There are tons of great LGBTQ celebrities out there who have been in the spotlight for years but new people are joining them all the time. Today we’re going to talk about some famous stars who came out and how it’s impacted their lives and their fans. Some stars like Paris Jackson, Demi Lovato and Khelani feel like keeping their options open and avoiding putting a label on themselves. Mollee Gray decided it was time to be honest with her fans when she was getting ready to marry the love of her life. Even though she’s married to Liam Hemsworth, Miley Cyrus says she considers her orientation to be an important part of her life and personality. Usually making a statement once is enough but Lil Nas X has to do so about three times before everyone got it through their heads!\n\nWhat do you think about the fact that more young celebs than ever before now feel as though it’s okay to be public about their orientations? Do you think they have a responsibility to their fans to be visible and open about this or do you think it should stay strictly as a private matter? Share your thoughts with us in the comment section and then click on the subscribe button to get access to more of the latest videos from TheTalko.\n\n-----------------------------------------------------------------------------------------\nOur Social Media:\nFacebook: https://www.facebook.com/TheTalko\nTwitter: https://twitter.com/thetalko\nInstagram: https://instagram.com